import React, { useEffect } from 'react';
import './About.css';
import ProgressBar from 'progressbar.js';

const About = () => {
  useEffect(() => {
    const htmlProgress = new ProgressBar.Circle('.html-progress', {
      color: '#D9534F',
      strokeWidth: 8,
      trailWidth: 8,
      trailColor: '#f4f4f4',
      duration: 1400,
      easing: 'easeInOut',
    });
    htmlProgress.animate(0.9);

    const cssProgress = new ProgressBar.Circle('.css-progress', {
      color: '#F0AD4E',
      strokeWidth: 8,
      trailWidth: 8,
      trailColor: '#f4f4f4',
      duration: 1400,
      easing: 'easeInOut',
    });
    cssProgress.animate(0.85);

    const phpProgress = new ProgressBar.Circle('.php-progress', {
      color: '#5bc0de',
      strokeWidth: 8,
      trailWidth: 8,
      trailColor: '#f4f4f4',
      duration: 1400,
      easing: 'easeInOut',
    });
    phpProgress.animate(0.8);

    const jqueryProgress = new ProgressBar.Circle('.jquery-progress', {
      color: '#5cb85c',
      strokeWidth: 8,
      trailWidth: 8,
      trailColor: '#f4f4f4',
      duration: 1400,
      easing: 'easeInOut',
    });
    jqueryProgress.animate(0.75);

    return () => {
      htmlProgress.destroy();
      cssProgress.destroy();
      phpProgress.destroy();
      jqueryProgress.destroy();
    };
  }, []);

  return (
    <section id="section-about" className="about-section">
      <div className="container text-center">
        <div className="row">
          <div className="col-md-12">
            <h2 className="section-title">About Me</h2>
            <p className="intro-paragraph">
              I am a website designer from Louisiana, with a strong focus in UI/UX design. I love to get new experiences and always learn from my surroundings. I've done more than 285 projects. You can check them out in my portfolio section. I look forward to any opportunities and challenges.
            </p>
          </div>
        </div>

        <div className="row progressbars-row">
          <div className="col-lg-3 progressbar-col">
            <div className="progressbar html-progress">
              <canvas width="200" height="200"></canvas>
              <div className="progress-text">90.0%</div>
            </div>
            <h4>HTML</h4>
          </div>
          <div className="col-lg-3 progressbar-col">
            <div className="progressbar css-progress">
              <canvas width="200" height="200"></canvas>
              <div className="progress-text">85.0%</div>
            </div>
            <h4>CSS</h4>
          </div>
          <div className="col-lg-3 progressbar-col">
            <div className="progressbar php-progress">
              <canvas width="200" height="200"></canvas>
              <div className="progress-text">80.0%</div>
            </div>
            <h4>PHP</h4>
          </div>
          <div className="col-lg-3 progressbar-col">
            <div className="progressbar jquery-progress">
              <canvas width="200" height="200"></canvas>
              <div className="progress-text">75.0%</div>
            </div>
            <h4>jQuery</h4>
          </div>
        </div>
      </div>
    </section>
  );
};

export default About;
